% function a_grav = getGrav(r_meas,valid_GPS_meas,rk,mu)
% a_grav =zeros(3,1);
% if valid_GPS_meas, 
%     rk_norm =norm(r_meas);    
% else
%     rk_norm =norm(rk);    
% end
% if rk_norm>=0,
%     a_grav     =-mu*r_meas/(rk_norm^3);
% end
% end
